const Statistics = ({ statistics, title }) => {

    return (
        <section class="statistics">
            {title}?<h2 class="title">Upload stats</h2>:null
            <ul class="stat-list">
                {statistics.map(el => (
                    <li class="item">
                        <span class="label">{el.label}</span>
                        <span class="percentage">{el.percentage}%</span>
                    </li>
                ))}
            </ul>
        </section>
    )
}

export default Statistics;
